import React, {useState, useRef} from 'react';
import Navbar from '../Components/Navbar'

import '../Styles/Predict.css'

function Predict() {

    let tempYear = useRef("");
    let tempMonth = useRef("");

    let coYear = useRef();
    let coMonth = useRef();

    const [tempRes, setTempRes] = useState("");
    const [coRes, setCoRes] = useState("");

    function submitTemp(e) {
        e.preventDefault();
        if (tempYear === "" || tempMonth === "") return false;
        if (parseInt(tempMonth.current.value) > 12 || parseInt(tempMonth.current.value) < 1) return false;
        if (parseInt(tempYear.current.value) > 2100 || parseInt(tempYear.current.value) < 2022) return false;


        console.log(tempMonth.current.value)
        // setTempRes(tempMonth);
    }

    function submitCo(e) {
        e.preventDefault();
        if (coMonth.current.value > 12 || coMonth.current.value< 1) return false;
        if (coYear.current.value > 2100 || coYear.current.value < 2022) return false;

        setCoRes(coMonth.current.value);
    }


    return (
        <>
        <Navbar />
            <h1 className="predict-title">Predict Future Values</h1>
            <div class="wrapper temp">

                <div className="inputs temp">
                    <h2 className="subtitle">Predict Future Temperature Value</h2>
                    <form onSubmit={submitTemp}>
                        <input ref={tempYear} class="year" type="number" placeholder={"Year (2023-2100)"} required />
                    </form>

                    <form onSubmit={submitTemp}>
                        <input ref={tempMonth} class="month" type="number" placeholder="Month (1 = Jan, 12 = Dec)" required />
                    </form>
                </div>

                <div className="results temp">
                    <h3>Temperature Result: </h3><h4>{tempRes}</h4>
                </div>

            </div>

            <div className="wrapper co">
                <div className="inputs co">
                    <h2 className="subtitle">Predict Future CO<sub>2</sub> Value</h2>
                    <input ref = {coYear} class="year" type="number" placeholder={"Year (2023-2100)"} required/> {/* 2023 - 2100 */}
                    <input ref = {coMonth} class="month" type="number" placeholder="Month (1 = Jan, 12 = Dec)" required/>
                </div>

                <div className="results co">
                    <h3>Co<sub>2</sub> Result: </h3><h4>{coRes}</h4>
                </div>
            </div>
        </>
    )
}

export default Predict;
